export default DashboardLayout;

import React, { useEffect, useState } from 'react';
import { 
  DollarSign, 
  ShoppingCart, 
  Package, 
  AlertTriangle, 
  ArrowRight,
  RefreshCcw,
  Sparkles
} from 'lucide-react';
import { Activity, Alert } from '../types';
import { GoogleGenAI } from "@google/genai";

const MOCK_ACTIVITY: Activity[] = [
  { id: '1', customer: 'John Doe', product: 'Premium Laptop', amount: 1299.00, date: '2024-03-15', status: 'Completed' },
  { id: '2', customer: 'Alice Smith', product: 'Wireless Keyboard', amount: 45.99, date: '2024-03-15', status: 'Completed' },
  { id: '3', customer: 'Bob Wilson', product: 'Gaming Monitor', amount: 349.50, date: '2024-03-14', status: 'Pending' },
  { id: '4', customer: 'Sarah Connor', product: 'Office Chair', amount: 189.00, date: '2024-03-14', status: 'Completed' },
  { id: '5', customer: 'Mike Ross', product: 'USB-C Hub', amount: 29.99, date: '2024-03-13', status: 'Canceled' },
];

const MOCK_ALERTS: Alert[] = [
  { id: '1', title: 'Low Stock: Premium Laptop', description: 'Inventory level below threshold (2 left)', type: 'warning', timestamp: '10 min ago' },
  { id: '2', title: 'Payment Overdue', description: 'Invoice #8822 for ABC Corp is 3 days late', type: 'error', timestamp: '1 hour ago' },
  { id: '3', title: 'Supply Arrival', description: '15 units of Gaming Monitors arriving today', type: 'info', timestamp: '2 hours ago' },
];

const ExecutiveDashboard: React.FC = () => {
  const [loading, setLoading] = useState(true);
  const [aiInsight, setAiInsight] = useState<string | null>(null);
  const [generatingInsight, setGeneratingInsight] = useState(false);

  useEffect(() => {
    const timer = setTimeout(() => setLoading(false), 800);
    return () => clearTimeout(timer);
  }, []);

  const generateAIInsight = async () => {
    setGeneratingInsight(true);
    try {
      const ai = new GoogleGenAI({ apiKey: process.env.API_KEY || '' });
      const response = await ai.models.generateContent({
        model: 'gemini-3-flash-preview',
        contents: `Based on this ERP data: Revenue $12,450, 48 orders, 122 inventory items, 5 low stock alerts. Provide a one-sentence strategic business insight.`,
      });
      setAiInsight(response.text || "Revenue is trending upwards but keep an eye on low stock items to maintain sales momentum.");
    } catch (e) {
      console.error(e);
      setAiInsight("Consider increasing stock for high-velocity items to avoid missed sales opportunities.");
    } finally {
      setGeneratingInsight(false);
    }
  };

  return (
    <div className="space-y-8 animate-in fade-in duration-700">
      <div className="flex justify-between items-end">
        <div>
          <h1 className="text-3xl font-bold text-slate-900 tracking-tight">Executive Dashboard</h1>
          <p className="text-slate-500 mt-1">Overview of key performance indicators.</p>
        </div>
        <button className="flex items-center gap-2 text-sm font-semibold text-slate-500 hover:text-slate-900 border border-slate-200 px-4 py-2 rounded-lg bg-white shadow-sm transition-all">
          View Reports <ArrowRight size={16} />
        </button>
      </div>

      {/* Summary Cards */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
        <StatCard 
          icon={<DollarSign size={24} />} 
          label="TOTAL REVENUE" 
          value="$12,450.00" 
          color="border-emerald-500" 
          iconBg="bg-emerald-50" 
          iconColor="text-emerald-600"
          trend="+12.5% from last month"
        />
        <StatCard 
          icon={<ShoppingCart size={24} />} 
          label="TOTAL ORDERS" 
          value="48" 
          color="border-blue-500" 
          iconBg="bg-blue-50" 
          iconColor="text-blue-600"
          trend="+5.2% from last month"
        />
        <StatCard 
          icon={<Package size={24} />} 
          label="ACTIVE INVENTORY" 
          value="122" 
          color="border-indigo-500" 
          iconBg="bg-indigo-50" 
          iconColor="text-indigo-600"
          trend="8 new items added"
        />
        <StatCard 
          icon={<AlertTriangle size={24} />} 
          label="LOW STOCK" 
          value="5" 
          color="border-rose-500" 
          iconBg="bg-rose-50" 
          iconColor="text-rose-600"
          trend="Critical action needed"
        />
      </div>

      {/* AI Insight Section */}
      <div className="bg-gradient-to-r from-blue-600 to-indigo-700 rounded-2xl p-6 text-white shadow-xl shadow-blue-900/10">
        <div className="flex items-center justify-between mb-4">
          <div className="flex items-center gap-2">
            <div className="bg-white/20 p-2 rounded-lg backdrop-blur-sm">
              <Sparkles size={20} className="text-blue-100" />
            </div>
            <h3 className="font-bold text-lg">AI Business Consultant</h3>
          </div>
          <button 
            onClick={generateAIInsight}
            disabled={generatingInsight}
            className="flex items-center gap-2 bg-white text-blue-700 px-4 py-2 rounded-lg text-sm font-bold hover:bg-blue-50 transition-all disabled:opacity-50"
          >
            {generatingInsight ? <RefreshCcw size={16} className="animate-spin" /> : <RefreshCcw size={16} />}
            Generate New Insight
          </button>
        </div>
        <div className="bg-black/10 rounded-xl p-4 border border-white/10 italic">
          {aiInsight ? aiInsight : "Click 'Generate New Insight' to get AI-powered business recommendations based on your current data."}
        </div>
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
        {/* Recent Activity */}
        <div className="lg:col-span-2 bg-white rounded-2xl border border-slate-200 shadow-sm overflow-hidden flex flex-col">
          <div className="p-6 border-b border-slate-100 flex justify-between items-center">
            <h3 className="font-bold text-slate-800">Recent Activity</h3>
            <button className="text-sm font-medium text-blue-600 hover:text-blue-700">View All Transactions &rarr;</button>
          </div>
          <div className="flex-1 min-h-[300px]">
            {loading ? (
              <div className="h-full flex flex-col items-center justify-center text-slate-400 gap-4">
                <RefreshCcw className="animate-spin" size={32} />
                <p className="font-medium">Loading activity data...</p>
              </div>
            ) : (
              <table className="w-full text-left text-sm">
                <thead>
                  <tr className="bg-slate-50/50 text-slate-400 font-bold uppercase tracking-wider">
                    <th className="px-6 py-4">Customer</th>
                    <th className="px-6 py-4">Product</th>
                    <th className="px-6 py-4">Amount</th>
                    <th className="px-6 py-4">Status</th>
                    <th className="px-6 py-4">Date</th>
                  </tr>
                </thead>
                <tbody className="divide-y divide-slate-100">
                  {MOCK_ACTIVITY.map(act => (
                    <tr key={act.id} className="hover:bg-slate-50/50 transition-colors">
                      <td className="px-6 py-4 font-semibold text-slate-800">{act.customer}</td>
                      <td className="px-6 py-4 text-slate-600">{act.product}</td>
                      <td className="px-6 py-4 font-mono font-bold text-slate-900">${act.amount.toFixed(2)}</td>
                      <td className="px-6 py-4">
                        <span className={`px-2 py-1 rounded-full text-[10px] font-bold uppercase tracking-tight ${
                          act.status === 'Completed' ? 'bg-emerald-50 text-emerald-600' : 
                          act.status === 'Pending' ? 'bg-amber-50 text-amber-600' : 'bg-rose-50 text-rose-600'
                        }`}>
                          {act.status}
                        </span>
                      </td>
                      <td className="px-6 py-4 text-slate-400">{act.date}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            )}
          </div>
        </div>

        {/* System Alerts */}
        <div className="bg-white rounded-2xl border border-slate-200 shadow-sm overflow-hidden flex flex-col">
          <div className="p-6 border-b border-slate-100 flex justify-between items-center">
            <h3 className="font-bold text-slate-800">System Alerts</h3>
          </div>
          <div className="flex-1 p-6 space-y-4">
            {loading ? (
              <div className="h-full flex items-center justify-center text-slate-400">
                <p className="animate-pulse font-medium">Loading alerts...</p>
              </div>
            ) : (
              <>
                {MOCK_ALERTS.map(alert => (
                  <div key={alert.id} className="flex gap-4 group cursor-pointer">
                    <div className={`mt-1 shrink-0 p-1.5 rounded-lg ${
                      alert.type === 'warning' ? 'bg-amber-50 text-amber-600' : 
                      alert.type === 'error' ? 'bg-rose-50 text-rose-600' : 'bg-blue-50 text-blue-600'
                    }`}>
                      <AlertTriangle size={16} />
                    </div>
                    <div>
                      <h4 className="font-bold text-slate-800 text-sm group-hover:text-blue-600 transition-colors">{alert.title}</h4>
                      <p className="text-slate-500 text-xs mt-0.5">{alert.description}</p>
                      <span className="text-[10px] font-bold text-slate-400 uppercase tracking-widest mt-2 inline-block">
                        {alert.timestamp}
                      </span>
                    </div>
                  </div>
                ))}
                <button className="w-full mt-4 py-3 border border-slate-100 rounded-xl text-sm font-bold text-slate-400 hover:text-blue-600 hover:border-blue-100 transition-all">
                  View All Alerts
                </button>
              </>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

const StatCard: React.FC<{ 
  icon: React.ReactNode; 
  label: string; 
  value: string; 
  color: string;
  iconBg: string;
  iconColor: string;
  trend?: string;
}> = ({ icon, label, value, color, iconBg, iconColor, trend }) => (
  <div className={`bg-white rounded-xl border-t-4 ${color} p-6 shadow-sm shadow-slate-200/50 hover:shadow-lg hover:-translate-y-1 transition-all group`}>
    <div className="flex items-start justify-between">
      <div>
        <div className="text-[10px] font-black tracking-[0.1em] text-slate-400 uppercase mb-2">{label}</div>
        <div className="text-2xl font-black text-slate-900">{value}</div>
        {trend && (
          <div className="mt-2 text-[10px] font-bold text-slate-400 tracking-tight">{trend}</div>
        )}
      </div>
      <div className={`${iconBg} ${iconColor} p-3 rounded-xl group-hover:scale-110 transition-transform`}>
        {icon}
      </div>
    </div>
  </div>
);

export default ExecutiveDashboard;

import React, { useState } from 'react';
import { Search, Plus, Filter, Download, Package } from 'lucide-react';
import { InventoryItem } from '../types';

const MOCK_INVENTORY: InventoryItem[] = [
  { id: '1', name: 'Premium Laptop', stock: 5, price: 1299.00, category: 'Electronics', sku: 'ELC-001' },
  { id: '2', name: 'Wireless Keyboard', stock: 45, price: 45.99, category: 'Accessories', sku: 'ACC-012' },
  { id: '3', name: 'Gaming Monitor', stock: 12, price: 349.50, category: 'Electronics', sku: 'ELC-005' },
  { id: '4', name: 'Office Chair', stock: 8, price: 189.00, category: 'Furniture', sku: 'FUR-002' },
  { id: '5', name: 'USB-C Hub', stock: 62, price: 29.99, category: 'Accessories', sku: 'ACC-008' },
  { id: '6', name: 'Standing Desk', stock: 3, price: 499.00, category: 'Furniture', sku: 'FUR-009' },
  { id: '7', name: 'Webcam 4K', stock: 18, price: 89.00, category: 'Electronics', sku: 'ELC-021' },
];

const InventoryView: React.FC = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [filterCategory, setFilterCategory] = useState('All');

  const categories = ['All', 'Electronics', 'Accessories', 'Furniture'];

  const filteredItems = MOCK_INVENTORY.filter(item => {
    const matchesSearch = item.name.toLowerCase().includes(searchTerm.toLowerCase()) || item.sku.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesCategory = filterCategory === 'All' || item.category === filterCategory;
    return matchesSearch && matchesCategory;
  });

  return (
    <div className="space-y-6">
      <div className="flex justify-between items-end">
        <div>
          <h1 className="text-3xl font-bold text-slate-900 tracking-tight">Inventory Control</h1>
          <p className="text-slate-500 mt-1">Manage stock levels and product catalog.</p>
        </div>
        <div className="flex gap-3">
          <button className="flex items-center gap-2 bg-white border border-slate-200 text-slate-600 px-4 py-2 rounded-lg text-sm font-bold hover:bg-slate-50 transition-all">
            <Download size={18} /> Export
          </button>
          <button className="flex items-center gap-2 bg-blue-600 text-white px-5 py-2 rounded-lg text-sm font-bold hover:bg-blue-700 transition-all shadow-lg shadow-blue-500/20 active:scale-95">
            <Plus size={18} /> Add Product
          </button>
        </div>
      </div>

      <div className="bg-white p-6 rounded-2xl border border-slate-200 shadow-sm space-y-4">
        <div className="flex flex-wrap gap-4 items-center justify-between">
          <div className="relative flex-1 min-w-[300px]">
            <Search className="absolute left-3 top-1/2 -translate-y-1/2 text-slate-400" size={18} />
            <input 
              type="text" 
              placeholder="Search by name or SKU..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="w-full pl-10 pr-4 py-2.5 bg-slate-50 border border-slate-200 rounded-xl text-sm focus:outline-none focus:ring-2 focus:ring-blue-500/20 focus:border-blue-500 transition-all"
            />
          </div>

          <div className="flex gap-2">
            {categories.map(cat => (
              <button
                key={cat}
                onClick={() => setFilterCategory(cat)}
                className={`px-4 py-2 rounded-xl text-xs font-bold transition-all ${
                  filterCategory === cat 
                    ? 'bg-slate-900 text-white shadow-md' 
                    : 'bg-white border border-slate-200 text-slate-500 hover:border-slate-300'
                }`}
              >
                {cat}
              </button>
            ))}
            <button className="p-2.5 border border-slate-200 rounded-xl text-slate-400 hover:text-slate-900 transition-colors">
              <Filter size={18} />
            </button>
          </div>
        </div>

        <div className="overflow-x-auto">
          <table className="w-full text-left text-sm">
            <thead>
              <tr className="bg-slate-50/50 text-slate-400 font-bold uppercase tracking-wider">
                <th className="px-4 py-4 rounded-l-xl">Product</th>
                <th className="px-4 py-4">SKU</th>
                <th className="px-4 py-4">Category</th>
                <th className="px-4 py-4">Stock Level</th>
                <th className="px-4 py-4">Price</th>
                <th className="px-4 py-4 rounded-r-xl">Action</th>
              </tr>
            </thead>
            <tbody className="divide-y divide-slate-100">
              {filteredItems.map(item => (
                <tr key={item.id} className="hover:bg-slate-50/50 transition-colors group">
                  <td className="px-4 py-4">
                    <div className="flex items-center gap-3">
                      <div className="w-10 h-10 rounded-lg bg-slate-100 flex items-center justify-center text-slate-400 group-hover:bg-blue-50 group-hover:text-blue-500 transition-colors">
                        <Package size={20} />
                      </div>
                      <span className="font-bold text-slate-800">{item.name}</span>
                    </div>
                  </td>
                  <td className="px-4 py-4 text-slate-500 font-mono text-xs">{item.sku}</td>
                  <td className="px-4 py-4">
                    <span className="bg-slate-100 text-slate-600 px-2 py-1 rounded text-[10px] font-bold uppercase tracking-wider">
                      {item.category}
                    </span>
                  </td>
                  <td className="px-4 py-4">
                    <div className="flex items-center gap-2">
                      <div className="flex-1 max-w-[80px] h-1.5 bg-slate-100 rounded-full overflow-hidden">
                        <div 
                          className={`h-full rounded-full transition-all duration-1000 ${
                            item.stock < 10 ? 'bg-rose-500' : 'bg-emerald-500'
                          }`}
                          style={{ width: `${Math.min((item.stock / 50) * 100, 100)}%` }}
                        ></div>
                      </div>
                      <span className={`text-xs font-bold ${item.stock < 10 ? 'text-rose-600' : 'text-slate-700'}`}>
                        {item.stock} units
                      </span>
